import React from "react"
import { createField, Input, Textarea } from "../../common/FormsControls/FormsControls"
import { reduxForm } from "redux-form"


const ProfileDataForm = ({ profile }) => {
    return <form>
        <div>
            <button onClick={() => { }}>Save</button>
        </div>
        <b>Fullname</b>: {createField("Full name", "fullname", [], Input)}
        < div >
            <b>Looking for a job</b>: {profile.lookingForAJob ? "yes" : "nope"}
            {createField("", "lookingForAJob", [], Input, { type: "checkbox" })}
        </div>
       
            <div>
                <b>My proffesional skills</b>: {profile.lookingForAJobDescription}
                {createField("", "lookingForAJob", [], Textarea)}
            </div>

        <div>
            <b>About me</b> {profile.aboutMe}
        </div>
        {/*<div>
                <b>Contacts</b>: {Object.keys(profile.contacts).map(key => {
                    return <Contact contactTitle={key} contactValue={profile.contacts[key]} />
                })}
            </div> */}
    </form>
}

const ProfileDataReduxForm = reduxForm({ form: 'edit-profle' })(ProfileDataForm)


export default ProfileDataReduxForm
